import * as React from 'react';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import imimage from './assets/image.png'

export default class ImageWindow extends React.Component{
    render(){
        return(
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main' }} position='fixed'>
                        <Box sx={{marginTop: 5, marginLeft: 5, marginRight: 5, marginBottom: 5,}}>
                            <img src={imimage} alt="image" width={70} height={70}  />
                        </Box>
                    
                    </Box>
                </Grid>
                <Grid item xs={6}>
                    <Box sx={{width: 475, height: 400, backgroundColor: 'secondary.main'}}></Box>
                </Grid>
            </Grid>
        )
    }
}
